import { useTranslation } from "react-i18next";
import styled from "styled-components";
import { useSelector } from "react-redux";

import { ComponentHeaderAuth } from "@components";
import { selectMerchant } from "@redux";
import { ModuleTelSignUp } from "src/Modules/tel/Sign";
export const PageSignUpTel = () => {
    //page hook
    const { t } = useTranslation();
    //page variable
    //page variable
    const merchant = useSelector(selectMerchant);

    return (
        <StyledContainer color={merchant.themeColor}>
            <ComponentHeaderAuth />
            <ModuleTelSignUp />
            <div className="sign_in">
                {t("page.auth.already_have_an_account")} <span>{t("page.auth.sign_in")}</span>
            </div>
        </StyledContainer>
    );
};

const StyledContainer = styled.div<{ color: string }>`
    .sign_in {
        position: relative;
        top: -85px;
        text-align: end;
        margin: 36px 36px 0 0;
        font-style: normal;
        font-weight: bold;
        font-size: 16px;
        line-height: 21px;
        span {
            color: ${(p) => p.color};
            cursor: pointer;
        }
    }
`;
